import React from "react";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import { motion } from "framer-motion";
import { FaLandmark, FaHotel, FaMonument, FaFlag } from "react-icons/fa";
import "./EgyptTimeline.css";

export default function EgyptTimeline() {
  const events = [
    {
      date: "3100 BC",
      title: "Unification of Upper and Lower Egypt",
      description: "King Menes unites Egypt and starts the Early Dynastic Period.",
      icon: FaMonument,
      color: "#e67e22",
      image: "data:image/jpeg;base64,"
    },
    {
      date: "2560 BC",
      title: "Construction of the Great Pyramid",
      description: "Pharaoh Khufu builds the Great Pyramid of Giza.",
      icon: FaMonument,
      color: "#f39c12",
      image: "https://upload.wikimedia.org/wikipedia/commons/e/e3/Kheops-Pyramid.jpg"
    },
    {
      date: "1800 AD",
      title: "Tourism Development",
      description: "Modern hotels and tourist infrastructure start developing in Egypt.",
      icon: FaHotel,
      color: "#27ae60",
      image: "data:image/jpeg;base64,"
    },
    {
      date: "1922 AD",
      title: "Partial Independence",
      description: "Egypt gains formal independence from Britain.",
      icon: FaFlag,
      color: "#2980b9",
      image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQVTAiLK6-ENK56AcM2sK0hGd_qnFQ6fEhsAw&s"
    },
    {
      date: "1952 AD",
      title: "July 23 Revolution",
      description: "End of monarchy and establishment of the Republic.",
      icon: FaFlag,
      color: "#c0392b",
      image: "data:image/jpeg;base64,"
    },
    {
      date: "Modern Day",
      title: "Tourist Attractions & Provinces",
      description: "Egypt is home to beautiful tourist destinations across different governorates.",
      icon: FaLandmark,
      color: "#8e44ad",
      image: "data:image/jpeg;base64,"
    },
  ];

  return (
    <>
      <Navbar />
      <div className="timeline-background">
        <div className="timeline-container">
          {events.map((event, index) => {
            const Icon = event.icon;
            const isLeft = index % 2 === 0;
            return (
              <motion.div
                key={index}
                className={`timeline-item ${isLeft ? "left" : "right"}`}
                initial={{ opacity: 0, x: isLeft ? -150 : 150 }}
                whileInView={{ opacity: 1, x: 0 }}
                transition={{ duration: 0.7 }}
                viewport={{ once: true }}
              >
                <div className="timeline-content">
                  {event.image && (
                    <img src={event.image} alt={event.title} className="timeline-img"/>
                  )}
                  <h3>{event.title}</h3>
                  <span className="timeline-date">{event.date}</span>
                  <p>{event.description}</p>
                </div>
                <div
                  className="timeline-icon"
                  style={{ backgroundColor: event.color }}
                >
                  <Icon size={26} color="#fff" />
                </div>
              </motion.div>
            );
          })}
        </div>
      </div>
      <Footer />
    </>
  );
}
